import React, { Component } from 'react';


class FormLogin extends Component {

    render() {
        return (
            <div className="shadow p-3 px-md-4 bg-white rounded ">
                <form className="form-login">
                    <div className="form-group">
                        <label>Usuario</label>
                        <input type="text" className="u-full-width" placeholder="Ingrese usuario"></input>
                    </div>
                    <div className="form-group">
                        <label>Contraseña</label>
                        <input type="password" className="u-full-width" placeholder="Ingrese contraseña"></input>
                    </div>

                    <div className="form-group text-right">
                        <button type="button" className="btn btn-primary">Ingresar</button>
                    </div>

                </form>
            </div>
        )
    };
}

export default FormLogin;
